post_text:
Welcome to the Mills Oval!

The track is open for public use, with the following restrictions:

Visitors will:

not use the track if experiencing symptoms of COVID-19;
always keep a safe distance of at least 6 feet from other people using the track;
wear a cloth face covering over mouth and nose to protect others when in locations where other walkers/ runners might be present (e.g. getting on and off the track);
stay off the grass; and
exercise caution around the raised edges of the track.

Thank you and enjoy the wonderful summer weather!

